<html>
<head>
<style>
.hover {
    position:fixed;
    margin: auto;
    left:50%;
    top:50%;
    padding:1em;
    border:1px solid black;
    border-radius:5px;
    display:none;
}
</style>

<script
			  src="https://code.jquery.com/jquery-3.7.1.min.js"

			  crossorigin="anonymous"></script>
<script>
$(document).ready( () => {
data = {
        "US": 5053,
        "BE": 1919,
        "ZA": 13,
        "NL": 315,
        "DE": 349,
        "CN": 1579,
        "GB": 277,
        "TR": 22,
        "PL": 5,
        "DZ": 4,
        "BG": 59,

        "": 13653,
        "RU": 61,
        "FR": 7089,
        "IE": 90,
        "IN": 87,
        "SE": 15,
        "AE": 91,
        "SG": 5504,
        "CA": 72,
        "CH": 199,
        "VN": 9,
        "HK": 2589,
        "RO": 226,
        "AU": 14,
        "IT": 16,
        "AT": 11,
        "NO": 4,
        "KR": 13,
        "JP": 72,
        "UA": 23,
        "CL": 3,
        "HU": 59,
        "PT": 40,
        "FI": 3,
        "ES": 40,
        "MD": 7,
        "IR": 3,
        "MY": 7,
        "MA": 52,
        "MM": 1,
        "RS": 1,
        "LU": 7,
        "IL": 5,
        "QA": 1,
        "TW": 5,
        "ID": 1,
        "GE": 1,
        "CO": 2,
        "MX": 2
    }
data.AQ = data[""]
delete (data[""])
max = Object.values(data).reduce((a,b) => Math.max(a,b))
Object.keys(data).forEach( function(k) {
    svgkey = "#" + k.toLowerCase()
    if (k =="AQ") {
        svgkey = "#AQ-AU"
    }
    console.log(svgkey)
    color = "#0000" + ( 256 - Math.ceil( (data[k] / max * 255))).toString(16).padStart(2,"0").toUpperCase();
    console.log(color)
    $(svgkey).attr("fill",color) 
    $(svgkey).on("mouseenter",
    (e) => { console.log("her" + k); $(".hover").show(); $(".hover").html(( k == "AQ" ? "private address" : k ) + ":" + data[k] ) }).on("mouseleave",

    (e) => { $(".hover").hide() })
})
})
</script>
